const Example = () => {

    //Note that you might not see the effect of the font for the theme if you do not have it installed locally. We do not retrieve fonts
    const cardStyle = useTokens('Card','container');
    const cardEyebrow = useTokens('Card','eyebrow');
    const cardContent= useTokens('Card','content');
    const cardTitle= useTokens('Card','title');
    const buttonStyle= useTokens('Card','button');


    return (<div class="card" style={cardStyle}>
              <div>
              <div style={cardEyebrow}>{cardEyebrow?.content}</div>
              <div style={cardTitle}>{cardTitle?.content}</div>
              </div>
              <div style={cardContent}>{cardContent?.content}</div>
              <button style={buttonStyle}>{buttonStyle?.content}</button>
        </div>);
}
render(<Example/>)
